import React from 'react';
import classes from './Toggle.module.css';
const Toggle =(props)=>{
    return(
        <div className = {classes.Toggle}>
            <p> a  </p>
            <p>b</p>
            <p>c</p>
            
        </div>
    );
}
export default Toggle;
